今まで見てきた通り，抽象化するときは，ただのsegment treeと比べてユーザーが決める要素が多い． 遅延セグ木に乗せられる条件を列挙する( 参考 )．写像$p$を$p(m,n):=m*m*\cdots *m$($m$の$n$回の積) $X$と二項演算$\circ$がモノイド $M$と二項演算$\bullet$がモノイド $(x_1\circ x_2)* p(m,n) = (x_1*p(m,n/2))\circ(x_2*p(m,n/2)) (x_1,x_2\in X)$ 子に伝播するときに半分ずつ伝播させるようなことができるか $(x* m_1)*m_2 = x*(m_1\times m_2)$ これが何なのか正直わからん(思考停止) なお，$p(m,n)$は高速に計算できる必要がある． モノイドについては SegTree を参照． template<typename X,typename M> struct LazySegmentTree{ public: using FX = function<X(X, X)>; using FA = function<X(X, M)>; using FM = function<M(M, M)>; using FP = function<M(M, int)>; int n; FX fx; FA fa; FM fm; FP fp; const X ex; const M em; vector<X> dat; vector<M> lazy; LazySegmentTree(int n_,FX fx_,FA fa_,FM fm_,FP fp_,X ex_,M em_):n(n_),fx(fx_),fa(fa_),fm(fm_),fp(fp_),ex(ex_),em(em_){ n=1; while(n<n_)n*=2; //完全二分木にする dat.assign(2*n-1,ex); lazy.assign(2*n-1,em); } void set(int k,X x){ dat[k+n-1]=x; } void build(){ for(int k=n-2;k>=0;k--){ dat[k]=fx(dat[2*k+1],dat[2*k+2]); } } void update(int a,int b,M x,int k,int l,int r){ eval(k,r-l); if(a <= l && r <= b){ lazy[k]= fm(lazy[k],x); eval(k,r-l); }else if(a < r && l < b){ update(a,b,x,k*2+1,l,(l+r)/2); update(a,b,x,k*2+2,(l+r)/2,r); dat[k]=fx(dat[k*2+1],dat[k*2+2]); } } void update(int k,M a){ update(k,k+1,a,0,0,n); } void update(int a,int b,M x){ update(a,b,x,0,0,n); } void eval(int k,int len){ if(lazy[k]==em)return; if(k<n-1){ lazy[k*2+1]= fm(lazy[k*2+1],lazy[k]); lazy[k*2+2] = fm(lazy[k*2+2],lazy[k]); } dat[k]=fa(dat[k],fp(lazy[k],len)); lazy[k]=em; } X query(int a,int b,int k,int l,int r){ eval(k,r-l); if(r<=a||b<=l)return ex;//範囲外 if(a<=l&&r<=b)return dat[k]; //範囲内である else{ X vl=query(a,b,k*2+1,l,(l+r)/2); X vr=query(a,b,k*2+2,(l+r)/2,r); return fx(vl,vr); } } X query(int a,int b){ return query(a,b,0,0,n); } X get(int k){ return query(k,k+1); }
}; 各パラメータのイメージは以下の通り． using X = long; // 持つデータの型
